section {
  background: var(--color-background, black);
  color: var(--color-white,white);
}

.section-container {
} /* Defined in Site CSS */

.teasers {
  display: grid;
  gap: 6rem;
}

.teaser {
  display: grid;
  gap: 1rem;

  img {
    width: 100%;
    border-radius: var(--border-radius);
  }

  .content-section {
    /* Defined in Site CSS */
    display: grid;
    place-items: flex-start;
    padding: 0;

    .heading {
      /* Defined in Site CSS */
      margin-bottom: 1.25rem;
      margin-left: 0;
      color: var(--color-white, white);
    }

    .body {
      margin-bottom: 2rem;
    }

    a.button {
      background-color: transparent;
      border: 1.5px solid white;

      &:hover {
        box-shadow: 0 0 0 2px white;
      }
    } /* Defined in Site CSS */
  }

  @media (min-width: 800px) {
    grid-template-columns: 1fr 1fr;
    place-items: center;
    gap: 4rem;

    /* switch direction for even items */
    &:nth-child(odd) img {
      grid-row: 1;
      grid-column: 2;
    }

    &:nth-child(even) img {
      grid-row: 1;
      grid-column: 1;
    }
  }
}

@media (min-width: 1200px) {
  section {
    gap: 6rem;
  }

  .teaser {
    gap: 10rem;

  }
     .heading {
      margin-bottom: 5rem;
    }

     .body {
      margin-bottom: 2.5rem;
    }
  }

footer {
  background: var(--color-background,black);
  color: white;
}

.section-container {
  display: flex;
  flex-wrap: wrap;
  justify-content: space-between;
  gap: 4rem;
}

.content {
  margin: initial;
  padding: 0;
  line-height: 1.1;
  color: white;
}

.nav-items {
  display: flex;
  flex-wrap: wrap;
  gap: 4rem;

  ul {
    display: grid;
    gap: 0.5rem;

    .link {
      border-bottom: 2px solid white;

      &:hover {
        border-color: transparent;
      }
    }
  }

h3 {
    font-weight: 500;
    font-size: 1.5rem;
    margin-bottom: 1rem;
  }
}

.section-container {
  max-width: 1400px;
} /* Defined in Site CSS */

.heading { /* Defined in Site CSS */
  text-align: center;
  margin-bottom: 3rem;
}

ul.cards {
  display: grid;
  place-items: center;
  gap: 1rem;



  li {
    max-width: 400px;
    padding: 1rem 2rem;


    figure {
      padding: 0 2rem;

      img {
        margin-bottom: 2rem;
        width: 100%; /* For Safari */ 
        border-radius: var(--border-radius);
      }
    }

    .info {

      .details {
        display: grid;
        text-align: center;
        margin-bottom: 1rem;

        span.name {
          font-weight: 600;
          margin-bottom: 0.25rem;
        }

        span.title{
          font-size: 1rem;
        }
      }

      .social {
        display: flex;
        justify-content: center;
        gap: 1.5rem;
        font-size: 1.5rem;
        color: var(--color-accent, rebeccapurple);

        a {
          transition: var(--transition, 0.1s transform);

          &:hover {
            transform: scale(1.1);
          }
        }
      }
    }
  }

  @media (min-width: 600px) {
    grid-template-columns: 1fr 1fr;
  }

  @media (min-width: 1000px) {
    grid-template-columns: 1fr 1fr 1fr;
  }
}

section {
  background: var(--color-brand);
  overflow: hidden;

  &.image-left {
    figure {
      grid-column: 1;
      grid-row: 1;
    }
    .body {
      grid-column: 2;
    }
  }
}

.section-container {
  display: flex;
  flex-direction: column-reverse;
  gap: 2rem;

  @media (min-width: 800px) {
    display: grid;
    grid-template-columns: 1fr 1fr;
    place-items: center;
    gap: 6rem;
    padding-block: 6rem;
  }
}

.body {
  color: var(--color-inverted);
  display: grid;
  place-items: start;
  padding-top: 2rem;

  .headline {
    color: var(--color-heading);
    font-family: var(--font-heading);
    font-weight: 700;
    font-size: clamp(2.75rem, 10vw, 3rem);
    line-height: 1.1;
    margin-bottom: 1.5rem;
  }

  .subheading {
    font-weight: 400;
    font-size: 1.125rem;
    margin-bottom: 2rem;
  }

  .button {
    font-weight: 500;
  }
}

figure {
  position: relative;

  img {
    border-radius: var(--border-radius);
    z-index: 1;
    position: relative;
  }
}

header {
  color: var(--color-white, white);
  position: relative;
  overflow: hidden;
  background: var(--color-background);

  &.simple {
    background: var(--color-background);
  }
}

img {
  position: absolute;
  inset: 0;
  height: 100%;
  width: 100%;
  object-fit: cover;
  z-index: 0;
}

.heading-group {
  background: #12121260; /* overlay */
  display: grid;
  place-items: center;
  padding-top: 12rem;
  padding-bottom: 12rem;
  position: relative;
  gap: 1rem;

  .heading {
    font-size: clamp(2rem, 10vw, 3.5rem);
    color: var(--color-white, white);
  }

  .subheading {
    place-self: center;
    font-size: 1.125rem;
    line-height: 1.3;
    color: var(--color-inverted);
  }
}

.buttons {
  margin-top: 1rem;
  display: flex;
  justify-content: center;
  gap: 1rem;

  .button {
    background: transparent;
    color: var(--color-inverted);
    border: 1.5px solid white;
  }
}

svg {
  width: 100%;
  background: #183b56a6;
  position: relative;
  fill: var(--background);
}

.content {
  :global(img) {
    width: 100%;
    margin: 2rem 0;
    box-shadow: var(--box-shadow);
    border-radius: var(--border-radius);
  }

  :global(p) {
    padding: 0.5rem 0;
    line-height: 1.5;
  }

  :global(a) {
    text-decoration: underline;
  }

  :global(h1) {
    font-size: 2.5rem;
    font-weight: 600;
    line-height: 1.2;
    margin-bottom: 0.5rem;
  }

  :global(h2) {
    font-size: 2rem;
    font-weight: 600;
    margin-bottom: 0.25rem;
    line-height: 1.2;
  }

  :global(h3) {
    font-size: 1.5rem;
    font-weight: 600;
    line-height: 1.2;
    margin-top: .5rem;
  }

  :global(ul) {
    list-style: disc;
    padding: 0.5rem 0;
    padding-left: 1.25rem;
  }

  :global(ol) {
    list-style: decimal;
    padding: 0.5rem 0;
    padding-left: 1.25rem;
  }

  :global(blockquote) {
    padding: 2rem;
    box-shadow: var(--box-shadow);
    border-radius: var(--border-radius);
  }
}

.section-container { /* Defined in Site CSS */
  display: flex;
  justify-content: space-between;
  flex-direction: column;
  align-items: center;
  gap: 1rem;
  padding-top: 1rem;
  padding-bottom: 1rem;

  @media (min-width: 600px) {
    flex-direction: row;
  }
}

nav {
  display: flex;
  gap: 1rem;
  font-size:.875rem;

  .link { /* Defined in Site CSS */
    border-color: transparent;

    &:hover {
      border-color: initial;
    }
  }
}

.primo {
  font-weight: 600;
  font-size: 0.75rem;

  a {
    text-decoration: underline; 
  }
}

.social-links {
  display: flex;
  gap: 1.5rem;
  font-size: 1.5rem;

  a {
    color: var(--color-accent, rebeccapurple);
    transition: var(--transition, 0.1s transform);

    &:hover {
      transform: scale(1.1);
    }
  }
}
